import React from "react";

const Footer = () => {
  return (
    <div className="w-full bg-yellow-400 absolute bottom-0 left-0 right-0 p-4 text-center">
      <p className="text-black font-extrabold text-sm">Found this helpful?</p>
      <div className="grid grid-cols-2">
        <a
          href="https://www.buymeacoffee.com/marktiddy"
          target="_blank"
          rel="noopener noreferrer"
        >
          Buy me a Beer
        </a>
        <a
          href="https://open.spotify.com/album/264XBsnQOBv1DXA75CXIQE"
          target="_blank"
          rel="noopener noreferrer"
          className="rounded bg-black text-yellow-400 p-2"
        >
          Listen to my band
        </a>
      </div>
    </div>
  );
};

export default Footer;
